import React, { Component } from "react";

class NavBar extends Component {
  render() {
    return (
      <nav
        className="navbar navbar-dark bg-light"
        style={{ background_color: "#AFAFAF", opacity: 0.1 }}>
        <a className="navbar-brand" href="/">
          Navbar
        </a>
      </nav>
    );
  }
}

export default NavBar;
